        { id: 1, title: 'Note 1', content: 'Content 1', category: 'personal' },
        { id: 2, title: 'Note 2', content: 'Content 2', category: 'work' },
        // más notas
    ]);

    const handleEditNote = (note) => {
        // lógica para editar la nota
        console.log('Editing note', note);
    };

    const handleDeleteNote = (noteId) => {
        // lógica para eliminar la nota
        console.log('Deleting note', noteId);
    };

    return (
        <div>
            <h1>Note App</h1>
            <NoteList 
                notes={notes} 
                onEditNote={handleEditNote} 
                onDeleteNote={handleDeleteNote} 
            />
        </div>
    );
};

export default App;
